rocess."]},{"cell_type":"markdown","id":"cb54b6e9","metadata":{"papermill":{"duration":0.006649,"end_time":"2023-01-21T13:00:14.915351","exception":false,"start_time":"2023-01-21T13:00:14.908702","status":"completed"},"tags":[]},"source":["# Preparing the data\n","\n","This dataset contains insightful information related to insurance claims, giving us an in-depth look into the demographic patterns of those receiving them. The dataset contains information on patient age, gender, BMI (Body Mass Index), blood pressure levels, diabetic status, number of children, smoking status and region.\n","\n","Credit for dataset goes to Sumit Kumar Shukla [https://data.world/sumitrock](http://)"]},{"cell_type":"markdown","id":"2ad1d64d","metadata":{"papermill":{"duration":0.006356,"end_time":"2023-01-21T13:00:14.928258","exception":false,"start_time":"2023-01-21T13:00:14.921902","status":"completed"},"tags":[]},"source":["# Processing and cleaning data\n","\n","We will load the data first using tidyverse package of R.\n","Then we will check for NULL or NA values.\n","Finally, we will summarize the data and look for any inconsistencies or incorrect data format."]},{"cell_type":"code","execution_count":2,"id":"7ec28582","metadata":{"execution":{"iopub.execute_input":"2023-01-21T13:00:14.980506Z","iopub.status.busy":"2023-01-21T13:00:14.944396Z","iopub.status.idle":"2023-01-21T13:00:15.333092Z","shell.execute_reply":"2023-01-21T13:00:15.330548Z"},"papermill":{"duration":0.40151,"end_time":"2023-01-21T13:00:15.336829","exception":false,"start_time":"2023-01-21T13:00:14.935319","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m1340\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m11\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m (4): gende